const AdvanceHooks = () => {

    const [count, setCount] = useState(0);

    const increment = () => {
        setCount(count+1);
        findElement();
    }

    const decrement=() => {
        setCount(count-1);
    }

// Create array from 1 to 100,000,000
const numbers = useMemo(()=>{
    console.log("High Computation array");
    return Array.from({ length: 100_000_000 }, (_, i) => i + 1)
},[]);

    const findElement = () => {

        const target = 99999999;
        // Use indexOf to find the element
        const index = numbers.indexOf(target);
      
        if (index !== -1) {
          console.log(`Element ${target} found at index ${index}`);
        } else {
          console.log(`Element ${target} not found`);
        }
      }

    
  return (
    <div>
